import React from 'react';
import Header from './components/Header';
import ResultsTable from './components/ResultsTable';
import ComparisonChart from './components/ComparisonChart';
import Footer from './components/Footer';

function App() {
  return (
    <div>
      <Header />
      <main>
        <ComparisonChart />
        <ResultsTable />
      </main>
      <Footer />
    </div>
  );
}

export default App;
